/* harmony default export */ __webpack_exports__["default"] = ("<ion-header [translucent]=\"true\" mode=\"md\">\n  <ion-toolbar class=\"toolbar-color\">\n    <ion-buttons slot=\"start\" style=\"color: white;\">\n      <ion-back-button></ion-back-button>\n    </ion-buttons>\n    <ion-title style=\"color: white;\">Privacy Policy</ion-title>\n  </ion-toolbar>\n</ion-header>\n\n<ion-content>\n<div class=\"center\"><img src=\"./assets/images/zfix_logo.png\"></div>\n\n<ion-text>\n  <h1>Kebijakan Privasi Penggunaan Aplikasi dan Layanan ZFix.</h1>\n  <p>\n    Kebijakan penggunaan di bawah merupakan ketentuan untuk aplikasi ZFix dari PT. Zanna\n    Infiniti Fixindo, termasuk penggunaan terhadap konten, layanan, dan fitur yang terdapat pada\n    aplikasi.\n  </p>\n  <br>\n    <p>\n      Dalam proses aktivasi, Anda setuju untuk menyediakan semua informasi seperti nama, NIK,\n      alamat, nomor telepon, email, dan informasi smartphone anda yang dibutuhkan oleh ZFix\n      melalui aplikasi ZFix. Adapun informasi yang diberikan harus benar apa adanya, lengkap, dan\n      akurat. Anda juga bersedia memberitahu kami jika terdapat perubahan pada informasi akun\n      Anda.  \n    </p>\n  <br>\n    <p>\n      ZFix sangat memahami pentingnya data pribadi anda sehingga kami berkomitmen untuk\n      menghormati, melindungi, dan tidak menyalahgunakan data pribadi anda. Namun, apabila\n      diharuskan oleh hukum yang berlaku untuk membagikan informasi Anda kepada institusi\n      pemerintahan atau pihak ketiga yang berhubungan, Anda setuju dan memberikan kami hak untuk\n      membagikan informasi tersebut.\n    </p>\n  <br>\n    <p>\n      Dengan melakukan proses aktivasi dan terus mengakses atau menggunakan aplikasi kami, itu\n      berarti Anda memahami dan menyetujui untuk terikat oleh kebijakan yang telah dijabarkan. Jika\n      Anda tidak setuju dengan semua ketentuan yang terdapat pada aplikasi ZFix, kami menghimbau\n      untuk Anda tidak menggunakan aplikasi ZFix.\n    </p>\n  <br>\n    <p><b>\n      2. Bagaimana Kami Menggunakan Data Pribadi yang Anda Berikan Kepada Kami?\n      </b>\n    </p>\n  <br>\n    <p>\n      Kami dapat mengumpulkan, menggunakan, mengungkapkan, dan/atau mengolah data pribadi\n      Anda untuk satu atau lebih dari tujuan-tujuan seperti berikut:\n    </p>\n  \n    <ol>\n    <li>\n      Kami mengumpulkan, menggunakan, mengungkapkan, dan/atau mengolah data pribadi\n      Anda untuk proses aktivasi yang anda lakukan guna menentukan status aktivasi anda\n      disetujui atau ditolak oleh Customer Care kami.\n    </li>\n    <li>\n      Kami mengumpulkan, menggunakan, mengungkapkan, dan/atau mengolah data pribadi\n      Anda ketika Anda melakukan proses pengajuan perbaikan guna menentukan status\n      pengajuan anda disetujui atau ditolak oleh Customer Care kami.\n    </li>\n    <li>\n    Ketika kami menghubungi anda atau berkomunikasi dengan anda melalui panggilan\n    telepon, pesan teks, dan/atau email guna untuk mengelola hubungan Anda dengan kami.\n    </li>\n    <li>\n      Ketika Anda menghubungi kami atau berkomunikasi dengan kami melalui panggilan\n      telepon, pesan teks, dan/atau email guna untuk mengelola keluhan serta masukan Anda\n      kepada kami.\n    </li>\n    <li>\n    Ketika kami melakukan penelitian, analisis, survei, dan/atau pengembangan perangkat\n    guna meningkatkan layanan dan/atau produk kami.\n    </li>\n    <li>\n      Untuk melakukan pemasaran dan/atau periklanan melalalui berbagai alat komunikasi\n      dan/informasi pemasaran yang berkaitan dengan layanan dan/atau produk kami\n    </li>\n    <li>\n      Untuk mencegah dan/atau menyelidiki pelanggaran nyata atau dugaan pelanggaran dari\n      Syarat dan Ketentuan yang berlaku baik dalam bentuk penipuan, kesalahan, dan/atau\n      kegiatan pelanggaran hukum lainnya.\n    </li>\n  </ol>\n  <br>\n    <p>\n      <b>3. Perubahan Kebijakan Penggunaan.</b>\n    </p>\n  <br>\n    <p>\n      ZFix dapat sewaktu-waktu merubah, menambahkan, dan mengganti Kebijakan Penggunaan yang\n      telah ditetapkan saat Aplikasi mengalami pembaharuan. Ketika hal tersebut terjadi Anda setuju\n      untuk melakukan penambahan informasi atau perubahan informasi sesuai kebijakan yang\n      berlaku. Oleh karena itu, kami menghimbau Anda untuk secara rutin memeriksa informasi yang\n      berkaitan dengan Kebijakan Penggunaan.\n    </p>\n  <br>\n  <p>\n  <b>4. Syarat dan Ketentuan Aplikasi ZFix.</b>\n  </p>\n  <br>\n    <p>\n      Ketika menekan tombol “SUBMIT” itu berarti anda menyetujui semua syarat dan ketentuan\n      yang berlaku dan/atau yang ditetapkan oleh aplikasi dan/atau layanan ZFix. Anda juga setuju\n      untuk mengakses dan/atau berlangganan layanan, produk, konten, dan/atau fitur lainnya di dalam\n      Aplikasi. Anda juga menyetujui syarat dan ketentuan yang berlaku sesuai hukum di Indonesia.\n      Jika Anda tidak menyetujui Syarat dan Ketentuan tersebut, Anda tidak diperkenankan untuk\n      menggunakan layanan pada aplikasi ZFix.\n    </p>\n  <br>\n    <p>\n      Jika anda melakukan akses dan/atau menggunakan layanan pada aplikasi ZFix, Anda telah\n      membuat perjanjian dengan ZFix dan oleh karena itu, anda harus melihat, membaca, serta\n      memahami seluruh Syarat dan Ketentuan Layanan dari aplikasi ZFix. Setiap menggunakan\n      layanan dari ZFix itu artinya anda menyetujui seluruh syarat dan ketentuan yang berlaku dari\n      ZFix.\n    </p>\n    <br>\n\n    <p>\n    <b>5. Syarat dan Ketentuan Layanan ZFix</b>\n    </p>\n  <br>\n    <p>\n      ZFix memiliki beberapa syarat dan ketentuan yang berlaku untuk anda para pengguna layanan\n      ZFix guna menentukan kelayakan proses aktivasi dan proses pengajuan yang telah anda lakukan.\n      Adapun syarat dan ketentuan dari layanan ZFix adalah sebagai berikut :\n    </p>\n  <br>\n    <ol>\n      <li>\n        Smartphone dan tablet dengan <b>kondisi layar dan LCD yang sempurna</b> (Tidak retak,\n        tidak pecah, terpasang dengan baik dan berfungsi baik) ketika melakukan aktivasi.\n      </li>\n      <li>\n        <b>Tidak ada pengembalian uang</b> jika layar dan LCD smartphone dan tablet dalam kondisi\n        tidak sempurna atau kegagalan pada saat melakukan aktivasi (test layar atau foto).\n      </li>\n      <li>\n        ZFix <b>tidak melindungi</b> kerusakan lain, selain pada bagian layar/LCD\n      </li>\n      <li>\n        ZFix <b>tidak melindungi</b> kerusakan layar yang dilakukan secara sengaja\n      </li>\n      <li>\n        ZFix <b>berhak menolak</b> aktivasi jika terjadi kecurangan atau upaya penipuan <b>seperti Tipe\n          HP tidak sesuai, IMEI tidak sesuai, atau ke tidak sesuaian apapun terkait identitas HP.</b>\n      </li>\n      <li>\n        ZFix <b>berhak menolak</b> aktivasi atau pengajuan perbaikan jika customer tidak mengikuti\n        syarat dan ketentuan yang berlaku\n      </li>\n      <li>\n        ZFix <b>berhak menolak</b> pengajuan perbaikan Jika :\n        <p>7.1 Terjadi penipuan atau upaya kecurangan apapun</p>\n        <p>7.2 Melakukan pergantian layar LCD ketika sudah melakukan aktivasi</p>\n      </li>\n      <li>\n        ZFix<b> berhak membatalkan</b> pengajuan perbaikan jika pemohon tidak mengungkapkan atau menyembunyikan fakta terkait kronologi kerusakan.\n      </li>\n      <li>\n        Customer <b>wajib aktivasi maksimal 3 hari</b> setelah pembelian produk ZFix.\n      </li>\n      <li>\n        <b>Proses Aktivasi</b> dilakukan paling lambat <b>3x24 jam.</b>\n      </li>\n      <li>\n        <b>Hologram yang ditempel</b> pada sisi kanan atau sisi kiri smartphone dan tablet anda adalah bagian <b>wajib</b> dari syarat dan ketentuan penggunaan layanan ZFix.\n      </li>\n      <li>\n        <b>Hologram</b> harus <b>berposisi horizontal</b> dan mengenai sisi layar dan body gadget\n      </li>\n      <li> \n        <b>Khusus ZFix Prime dan ZFix Prime Plus, Hologram</b> yang <b>rusak atau hilang</b> baru akan diproses pengajuan perbaikannya 2 bulan setelah aktivasi.\n      </li>\n      <li>\n         <b>Hologram</b> yang terpasang pada gadget <b>tidak diperbolehkan</b> untuk <b>ditimpah/ditambahkan</b> dengan perekat lainnya seperti <b>selotip atau sejenisnya</b>.\n      </li>\n      <li>\n        <b>Khusus Prime Lite, proses perbaikan baru akan diproses setelah 14 hari pengajuan\n          perbaikan.</b>\n      </li>\n      <li>\n        Untuk <b>android 10 wajib</b> melakukan screen recorder yang dimulai dari anda mengetik *#06# untuk pengecekan IMEI.\n      </li>\n      <li>\n        <b>ZFix hanya bertanggung jawab</b> menutupi nilai perbaikan sesuai dengan yang tercantum pada masing-masing packaging produk.\n        <ol type=\"a\">\n          <li>\n            Prime Lite, nilai perbaikan Rp. 500.000\n          </li>\n          <li>\n            Prime, nilai perbaikan Rp. 1.500.000\n          </li>\n          <li>\n            Prime Plus, nilai perbaikan Rp. 2.500.000\n          </li>\n        </ol>\n      </li>\n  \n      <li>\n        Jika terjadi <b>kelebihan nilai perbaikan,</b> biaya <b>ditanggung oleh customer</b> yang bersangkutan.\n      </li>\n      <li>\n        Setelah gadget anda diperbaiki, Anda akan <b>mendapatkan jaminan</b> perbaikan diluar\n        <b>kerusakan fisik selama 60 hari. Kerusakan ini meliputi LCD error atau touch screen\n        tidak berfungsi.</b>\n      </li>\n      <li>\n        Jika gadget anda <b>tidak dapat diperbaiki,</b> maka akan ada <b>pengembalian uang sebesar 3 kali lipat</b> (Jika spare part tidak ada) dari <b>harga produk ZFix</b> yang anda beli.\n      </li>\n    </ol>\n  \n    <p><b>6. Disclaimer</b></p><br>\n    <p>\n      Aplikasi ini mungkin mengandung kesalahan pengetikan, ketidakakuratan, atau kendala teknis ketika digunakan. Oleh karena itu, kami akan terus melakukan pengembangan, perubahan, dan/atau perbaikan informasi atau aplikasi secara berkala guna meningkatkan kenyamanan dan keamanan bagi pengguna kami. Kami tidak menjamin atau menanggung segala tanggung jawab atau kewajiban kelengkapan atau kegunaan segala informasi.  \n    </p>\n  <br>\n    <p>\n      Dengan mengakses dan/atau menggunakan pelayanan dari ZFix, Anda juga setuju untuk melindungi ZFix dan setiap pegawai, direktur, serta petugas di ZFix dari segala macam klaim, tuntutan, kewajiban, keputusan, tindakan, dan penyelesaian.\n    </p>\n  <br>\n    <p><b>7. Kontak Kami</b></p><br>\n    \n    <p>\n      Kami menerima setiap pertanyaan, masukan, masalah, serta keluhan yang ingin anda sampaikan kepada kami. Anda bisa menghubungi kami untuk melakukan pertanyaan, masukan, masalah, serta keluhan ke nomor customer care kami di 0822-2999-1919 atau email kami di  <a href=\"mailto:cs@zfix.id\">cs@zfix.id.</a>\n    </p>\n\n    <ion-item>\n            <ion-label>Saya, setuju!</ion-label>\n            <ion-checkbox checked slot=\"start\" [(ngModel)]=\"checkBox\" (ionChange)=\"onChange()\"></ion-checkbox>\n    </ion-item>\n\n<div class=\"center\" *ngIf=\"visability\">\n<ion-button routerLink=\"/register\">Continue</ion-button>\n</div> \n<br>\n</ion-text>\n</ion-content>\n\n");

